import './uploads.css';
import './main.css';
import Gallery from "./gallery";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h1 class="top-heading"> <img
        src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
        width="50"
        height="55"
        alt="MoodMelody Logo"
      /> MoodMelody </h1>
</div>

  );
}
export default Home;
